  const [ moviles, setMoviles ] = useState([])
  const handleChange = (moviles) => {
      console.log(moviles);
      setMoviles(moviles);
  }

  return (
    <div className="row">
        <div className="col s4">
            <Reloj />
            <Mapa moviles={ moviles } className="d-none d-md-block" />
        </div>
        <div className="col s8">
            <Servicios />  
            <Moviles />        
        </div>       
    </div>
  );
}

export default MonitorFrecuencia;
